import React, { useEffect } from "react";

const RealisticPizzaBurger = () => {
  useEffect(() => {
    // Draw Pizza - More realistic
    const pizzaCanvas = document.getElementById("pizzaCanvas");
    const pizzaCtx = pizzaCanvas.getContext("2d");

    // Pizza Base
    pizzaCtx.fillStyle = "#f1c27d"; // Pizza dough
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 80, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pizza Crust
    pizzaCtx.fillStyle = "#d28c5a"; // Crust color
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 85, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pizza Sauce (inner circle)
    pizzaCtx.fillStyle = "#ff6347"; // Tomato sauce
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 70, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Cheese Layer
    pizzaCtx.fillStyle = "#f2d34a"; // Cheese color
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 65, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Toppings - Pepperoni
    pizzaCtx.fillStyle = "#ff4d4d"; // Pepperoni red
    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 70, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 70, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(85, 130, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(115, 140, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(75, 160, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 45, 12, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Toppings - Green Peppers
    pizzaCtx.fillStyle = "#9ACD32"; // Green peppers
    pizzaCtx.beginPath();
    pizzaCtx.arc(50, 110, 7, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(110, 115, 7, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Draw Burger - More realistic
    const burgerCanvas = document.getElementById("burgerCanvas");
    const burgerCtx = burgerCanvas.getContext("2d");

    // Bottom Bun
    burgerCtx.fillStyle = "#ffcc66"; // Bun color
    burgerCtx.beginPath();
    burgerCtx.arc(100, 160, 60, Math.PI, 0, true);
    burgerCtx.fill();

    // Patty (burger)
    burgerCtx.fillStyle = "#804000"; // Meat patty
    burgerCtx.beginPath();
    burgerCtx.arc(100, 130, 50, 0, Math.PI * 2);
    burgerCtx.fill();

    // Lettuce
    burgerCtx.fillStyle = "#32CD32"; // Lettuce
    burgerCtx.beginPath();
    burgerCtx.arc(100, 110, 50, Math.PI, 0, true);
    burgerCtx.fill();

    // Tomato (sliced)
    burgerCtx.fillStyle = "#ff6347"; // Tomato red
    burgerCtx.beginPath();
    burgerCtx.arc(100, 90, 40, Math.PI, 0, true);
    burgerCtx.fill();

    // Cheese Slice
    burgerCtx.fillStyle = "#f2d34a"; // Cheese color
    burgerCtx.fillRect(50, 75, 100, 10); // A slice of cheese

    // Top Bun
    burgerCtx.fillStyle = "#ffcc66"; // Top Bun color
    burgerCtx.beginPath();
    burgerCtx.arc(100, 60, 60, 0, Math.PI * 2);
    burgerCtx.fill();

    // Sesame Seeds
    burgerCtx.fillStyle = "#fff";
    burgerCtx.beginPath();
    burgerCtx.arc(70, 45, 5, 0, Math.PI * 2);
    burgerCtx.arc(100, 40, 5, 0, Math.PI * 2);
    burgerCtx.arc(130, 45, 5, 0, Math.PI * 2);
    burgerCtx.fill();
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Realistic Pizza & Burger</h2>
      <div style={styles.canvasContainer}>
        <canvas id="pizzaCanvas" width="200" height="200" style={styles.canvas}></canvas>
        <canvas id="burgerCanvas" width="200" height="200" style={styles.canvas}></canvas>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #f7d9e3, #fcc2e4)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "500px",
    margin: "auto",
  },
  heading: {
    color: "#ff77aa",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
  },
  canvasContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
  },
  canvas: {
    border: "3px solid #ff69b4",
    borderRadius: "10px",
    backgroundColor: "#fffaf0",
  },
};

export default RealisticPizzaBurger;
